import Navigation from "../components/Navigation";
import Head from "next/head";

const Layout = (props) => (
  <div>
    <Head>
      <title>Default title</title>
    </Head>
    <Navigation />
    {props.children}

    <p>Footer: copyright 2020</p>
  </div>
);

export default Layout;
